    def get_curr_color(self):
        if self.white_rb.isChecked():
            return (255,255,255,255)
        if self.blue_rb.isChecked():
            return (0,0,255,255)
        if self.green_rb.isChecked():
            return (0,170,0,255)
        if self.red_rb.isChecked():
            return (255,0,0,255)

    def get_section_data(self):
        x_start = self.x_start_entry.value()
        y_start = self.y_start_entry.value()
        x_end = self.x_end_entry.value()
        y_end = self.y_end_entry.value()
        return (x_start, y_start), (x_end, y_end)
    
    def get_spectre_data(self):
        x_center = self.x_center_entry.value()
        y_center = self.y_center_entry.value()
        r = self.radius_entry.value()
        step = self.step_entry.value()
        return(x_center, y_center), r, step
    
    def get_algo_mode(self,id_method):
        if id_method == 0:
            return line_algos.algo_dda
        if id_method == 1:
            return line_algos.algo_bresenham_int
        if id_method == 2:
            return line_algos.algo_bresenham_float
        if id_method == 3:
            return line_algos.algo_bresenham_stepless
        if id_method == 4:
            return line_algos.algo_wu